import React from "react";
import "./contact.css";

const ContactInfo = () => {
  return (
    <div className="contact-info">
      <h2>Kontaktn√≠ informace</h2>
      <div className="contact-list">
        <div className="contact-item">
          <span>Email:</span> info@example.com
        </div>
        <div className="contact-item">
          <span>Second Email:</span> support@example.com
        </div>
        <div className="contact-item">
          <span>Name:</span> John Doe
        </div>
        <div className="contact-item">
          <span>Phone:</span> +1 123 456 7890
        </div>
        <div className="contact-item">
          <span>Address:</span> 123 Main Street, City, Country
        </div>
        <div className="contact-item">
          <span>GDPR:</span> GDPR information and link
        </div>
      </div>
    </div>
  );
};

export default ContactInfo;
